using Microsoft.Extensions.AI;
using ModelContextProtocol.Server;
using System.ComponentModel;

namespace SevillaDotNetMCPServer.Tools
{
    [McpServerToolType]
    public class LogoTool
    {
        /// <summary>
        /// Retrieves the SevillaDotNet logo from the server.
        /// This method returns multiple pieces of AIContent, including text descriptions and image data.
        /// </summary>
        [McpServerTool(Name = "getSevillaDotNetLogo"), Description("Get the SevillaDotNet logo from the server")]
        public static IEnumerable<AIContent> GetSevillaDotNetLogo() => [
            // Informational text about the logo
            new TextContent("This is the SevillaDotNet logo:"),

            // Image data encoded in base64 format
            new DataContent(MCP_SEVILLADOTNET_LOGO),

            // Final message indicating what was displayed
            new TextContent("The image above is the MCP SevillaDotNet logo.")
        ];

        internal const string MCP_SEVILLADOTNET_LOGO =
            "data:image/jpeg;base64,";
    }
}
